import React from 'react';
import { IRowProps } from '../types/types';
import Column from './Column';
import Basemap from './Map';

const Row = (props: IRowProps) => {

    const {
        color,
        height
    } = props

    return (
        <>
            <div className="row">
                <Column style={{
                    backgroundColor: color[0],
                    height: height,

                }}
                    content={<Basemap id='map' mapContainer='map'/>}
                />
                <Column style={{
                    backgroundColor: color[1],
                    height: height,
                }}
                    content={<Basemap id='overview' mapContainer='overview' />}
                />
                <Column style={{
                    backgroundColor: color[2],
                    height: height,
                }}
                content={<Basemap id='overview' mapContainer='overview' />}
                />
            </div>
        </>
    )
}

export default Row;
